import { LiaToolsSolid } from "react-icons/lia";
import getStyling from "./style";
import { FC } from "react";
import { IMappedIconProps } from "./interface";
import {
  IoBuildOutline,
  IoConstructOutline,
  IoSettingsOutline,
  IoHammerOutline,
  IoReaderOutline,
  IoAddCircleOutline,
  IoAdd,
  IoAlertCircleOutline,
  IoBagAddOutline,
  IoBatteryHalf,
  IoBatteryFull,
  IoBriefcaseOutline,
  IoBrushOutline,
  IoBulbOutline,
  IoCalculatorOutline,
  IoCalendarNumberOutline,
  IoCalendarOutline,
  IoCallOutline,
  IoCameraOutline,
  IoCarOutline,
  IoCarSportOutline,
  IoCardOutline,
  IoCartOutline,
  IoCashOutline,
  IoCellularOutline,
  IoChatboxEllipsesOutline,
  IoChatbubbleEllipsesOutline,
  IoCheckboxOutline,
  IoCheckmarkCircleOutline,
  IoCheckmarkDone,
  IoCheckmark,
  IoClipboardOutline,
  IoColorFillOutline,
  IoCutOutline,
  IoDesktopOutline,
  IoDocumentOutline,
  IoDocumentTextOutline,
  IoExtensionPuzzleOutline,
  IoFlameOutline,
  IoFlashOutline,
  IoFlashlightOutline,
  IoFlaskOutline,
  IoFunnelOutline,
  IoHelp,
  IoHomeOutline,
  IoHourglassOutline,
  IoInformation,
  IoKeyOutline,
  IoLibraryOutline,
  IoList,
  IoLocationOutline,
  IoLockClosedOutline,
  IoLockOpenOutline,
  IoWifiOutline,
  IoMailOutline,
  IoManOutline,
  IoPencilOutline,
  IoPeopleOutline,
  IoPowerOutline,
  IoPrintOutline,
  IoSaveOutline,
  IoVideocamOutline,
} from "react-icons/io5";

const MappedIcon: FC<IMappedIconProps> = (props) => {
  const {
    icon: { name },
